  const [todos,setTodos]= useState([
    {
      id : 1,
      title : 'todo'
    }
   
  ]
  )
 
  return (
    <div>
      {
        todo.map(item=>(
          <h1 key={item.id}>{item.title}</h1>
        ))
      }
    </div>
  )
}

export default App
